import LoginPage from '.Screens/loginPage';
import { BrowserRouter as Router, Route } from "react-router-dom";

function App() {
  return (
    <Router>
      <main className='App'>
        <Route path="/register" component={LoginPage}/>
      </main>
    </Router>
  );
}

export default App;
